import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import TodoWrapper from './components/TodoWrapper';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/todos" element={<TodoWrapper />} />
      </Routes>
    </Router>
  );
}

export default App;
